import Infowindow from './infowindow'
import {connect} from 'react-redux'

// import DialogViolation from './dialogviolations'
const mapStateToProps=({searchViolation})=>({
    Infowindow:searchViolation.showInfowindow,
    InfoViolation:searchViolation.showInfowindow.info
})
export default connect(mapStateToProps,null) (Infowindow)
